import React from 'react';

const RegistrationTable = ({ data = [] }) => {
  const totalRows = 10;  // Define the number of rows to display
  const rows = data.length > 0 ? data.slice(0, totalRows) : [];
  const emptyRows = totalRows - rows.length;  // Fill remaining rows with empty entries if needed

  return (
    <div>
      <h2>Registration Data</h2>
      <table style={{
        width: '100%',
        borderCollapse: 'collapse',
        tableLayout: 'fixed',
        backgroundColor: '#f3f3f3' // Light background like in the image
      }}>
        <thead>
          <tr>
            {[
              "Room", "Sector", "Fee Per Month", "Food Choice", "Stay From", "Duration", "Course", 
              "Registration No", "First Name", "Middle Name", "Last Name", "Gender", "Contact", 
              "Email", "Emergency Contact", "Guardian Name", "Guardian Relation", "Guardian Contact", 
              "Permanent Address", "Permanent City", "Permanent State", "Permanent Pincode"
            ].map((header, index) => (
              <th key={index} style={{
                border: '1px solid #ccc', // Light grey border
                padding: '8px',
                backgroundColor: '#d9eaf2', // Header background similar to the image
                fontWeight: 'bold',
                textAlign: 'left'
              }}>{header}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {rows.map((item, index) => (
            <tr key={index} style={{ backgroundColor: index % 2 === 0 ? '#ffffff' : '#eaf4fb' }}>
              <td style={cellStyle}>{item.room}</td>
              <td style={cellStyle}>{item.sector}</td>
              <td style={cellStyle}>{item.feePerMonth}</td>
              <td style={cellStyle}>{item.foodChoice}</td>
              <td style={cellStyle}>{item.stayFrom}</td>
              <td style={cellStyle}>{item.duration}</td>
              <td style={cellStyle}>{item.course}</td>
              <td style={cellStyle}>{item.registrationNo}</td>
              <td style={cellStyle}>{item.firstName}</td>
              <td style={cellStyle}>{item.middleName}</td>
              <td style={cellStyle}>{item.lastName}</td>
              <td style={cellStyle}>{item.gender}</td>
              <td style={cellStyle}>{item.contact}</td>
              <td style={cellStyle}>{item.email}</td>
              <td style={cellStyle}>{item.emergencyContact}</td>
              <td style={cellStyle}>{item.guardianName}</td>
              <td style={cellStyle}>{item.guardianRelation}</td>
              <td style={cellStyle}>{item.guardianContact}</td>
              <td style={cellStyle}>{item.permanentAddress}</td>
              <td style={cellStyle}>{item.permanentCity}</td>
              <td style={cellStyle}>{item.permanentState}</td>
              <td style={cellStyle}>{item.permanentPincode}</td>
            </tr>
          ))}
          {/* Add empty rows if data is less than totalRows */}
          {emptyRows > 0 && (
            Array.from({ length: emptyRows }, (_, index) => (
              <tr key={`empty-row-${index}`} style={{ backgroundColor: '#ffffff' }}>
                <td colSpan="22" style={{
                  ...cellStyle,
                  textAlign: 'center'
                }}>&nbsp;</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

const cellStyle = {
  border: '1px solid #ccc',
  padding: '8px',
  textAlign: 'center',
  color: '#333',
};

export default RegistrationTable;
